  const getTodosByFilter = useSelector(state=>state.visibilityFilter)
  const todos = useSelector(state => state.todos)
    console.log(todos)
    console.log(getTodosByFilter)
  return (
      <div className="App myApp">
        <Header />
        <TodoList
            getTodosByFilter={getTodosByFilter}
            todos={todos}
        />
      </div>
  );
}

export default App;
